import React from 'react'
import Will from '../images/Will.jpg'
const BadgeGrinders = () => {
    return (
        <div className="BadgeGrindersCont">
            {/* <h1> Coming Soon!</h1> */}
            <div className="BadgeGrindersCard">
                <img src={Will} />
            </div>
        </div>
    )
}

export default BadgeGrinders
